import './index.scss'
import Loader from 'react-loaders'

const Contact = () => {
    return (
        <>
            <div className='Container Contact'>
                Hola
                <div className='Text-Zone'></div>
            </div>
            <Loader type='ball-rotate'/>
        </>
    );
}

export default Contact;
